INSERT INTO `hpadmin_indexbullhorninfo` VALUES ('1', '/static/upload/1515421709.jpg', ' 加勒比海盗5：死无对证', '《加勒比海盗5：死无对证》：故事发生在《加勒比海盗3：世界的尽头》沉船湾之战20年后。 男孩亨利（布兰顿·思怀兹 Brenton Thwaites 饰）随英国海军出航寻找被聚魂棺诅咒的父亲“深海阎王”威尔·特纳（奥兰多·布鲁姆 Orlando Bloom 饰）', 'admin', 'admin', '/news/1', '1', '1');
INSERT INTO `hpadmin_indexbullhorninfo` VALUES ('2', '/static/upload/1515421717.jpg', '苹果四寸手机为何要配置强大的A9处理器？', '苹果明年初有可能对外发布一款经过升级的四英寸手机，相当于iPhone 5s。该手机将会配置苹果在2015年旗舰手机中采用的A9处理器。配置性能如此强大的应用处理器？', 'admin', '2017-12-8 23', '/news/1', '1', '0');
INSERT INTO `hpadmin_indexbullhorninfo` VALUES ('3', '/static/upload/1515421727.jpg', '广电总局发布TVOS2.0 华为阿里参与研发', 'TVOS2.0是在TVOS1.0与华为MediaOS及阿里巴巴YunOS融合的基础上，打造的新一代智能电视操作系统。华为主要承担开发工作，内置的电视购物商城由阿里方面负责。', 'Benjamin', '2017-12-8 ', '/news/1', '1', '0');
INSERT INTO `HPAdmin_indexbullhorninfo` VALUES ('1', '/static/upload/1515421709.jpg', ' 加勒比海盗5：死无对证', '《加勒比海盗5：死无对证》：故事发生在《加勒比海盗3：世界的尽头》沉船湾之战20年后。 男孩亨利（布兰顿·思怀兹 Brenton Thwaites 饰）随英国海军出航寻找被聚魂棺诅咒的父亲“深海阎王”威尔·特纳（奥兰多·布鲁姆 Orlando Bloom 饰）', 'admin', 'admin', '/news/1', '1', '1');
INSERT INTO `HPAdmin_indexbullhorninfo` VALUES ('2', '/static/upload/1515421717.jpg', '苹果四寸手机为何要配置强大的A9处理器？', '苹果明年初有可能对外发布一款经过升级的四英寸手机，相当于iPhone 5s。该手机将会配置苹果在2015年旗舰手机中采用的A9处理器。配置性能如此强大的应用处理器？', 'admin', '2017-12-8 23', '/news/1', '1', '0');
INSERT INTO `HPAdmin_indexbullhorninfo` VALUES ('3', '/static/upload/1515421727.jpg', '广电总局发布TVOS2.0 华为阿里参与研发', 'TVOS2.0是在TVOS1.0与华为MediaOS及阿里巴巴YunOS融合的基础上，打造的新一代智能电视操作系统。华为主要承担开发工作，内置的电视购物商城由阿里方面负责。', 'Benjamin', '2017-12-8 ', '/news/1', '1', '0');
