INSERT INTO `HPAdmin_news` VALUES ('1', '加勒比海盗5：死无对证 超前观影报道', '<p>\r\n	<span style=\"color:#333333;font-family:&quot;font-size:14px;background-color:#FAFAFA;\">&nbsp;&nbsp;&nbsp;&nbsp;《加勒比海盗5：死无对证》：故事发生在《加勒比海盗3：世界的尽头》沉船湾之战20年后。 男孩亨利（布兰顿·思怀兹 Brenton Thwaites 饰）随英国海军出航寻找被聚魂棺诅咒的父亲“深海阎王”威尔·特纳（奥兰多·布鲁姆 Orlando Bloom 饰），却在百慕大三角遭遇被解封的亡灵萨拉查船长（哈维尔·巴登 Javier Bardem 饰）。获取自由的萨拉查屠尽加勒比海盗，征服了整个海域，手刃了“黑胡子”爱德华·蒂奇（伊恩·麦柯肖恩 Ian McShane 饰）的里海海盗王赫克托·巴博萨船长（杰弗里·拉什 Geoffrey Rush 饰）在女巫Haifaa Meni(格什菲·法拉哈尼 Golshifteh Farahani 饰)口中得知了萨拉查的真实目的：为寻找他的宿敌杰克船长（约翰尼·德普 Johnny Depp 饰）。海盗的命运皆压在落魄的老杰克被封印的黑珍珠号，以及天文学家卡琳娜·史密斯（卡雅·斯考达里奥 Kaya Scodelario 饰）口中的远古三叉戟上。</span> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<h2 class=\"headline-1 custom-title \" style=\"font-size:22px;color:#333333;font-family:&quot;font-weight:500;background:url(&quot;\">\r\n	<span class=\"headline-content\" style=\"line-height:1;color:#000000;\">基本信息</span> \r\n</h2>\r\n<div class=\"lemma-summary\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<div class=\"para\">\r\n		《加勒比海盗5：死无对证》<span style=\"font-size:10.9091px;line-height:0;vertical-align:baseline;color:#3366CC;\">[1]</span><a name=\"ref_[1]_11465507\"></a>&nbsp;&nbsp;<i>（<i>Pirates of the Caribbean: Dead Men Tell No Tales/Salazar\'s Revenge</i>）</i>是由迪士尼电影公司推出的奇幻历险电影加勒比海盗系列的第五部作品<span style=\"font-size:10.9091px;line-height:0;vertical-align:baseline;color:#3366CC;\">[2]</span><a name=\"ref_[2]_11465507\"></a>&nbsp;&nbsp;，由<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E4%B9%94%E9%98%BF%E5%90%89%E5%A7%86%C2%B7%E7%BD%97%E6%81%A9%E5%B0%BC\">乔阿吉姆·罗恩尼</a>、<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E8%89%BE%E6%96%AF%E5%BD%AD%C2%B7%E5%B1%B1%E5%BE%B7%E4%BC%AF%E6%A0%BC\">艾斯彭·山德伯格</a>联合执导，<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E6%9D%B0%E7%91%9E%C2%B7%E5%B8%83%E9%B2%81%E5%85%8B%E6%B5%B7%E9%BB%98\">杰瑞·布鲁克海默</a>制片，<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E7%BA%A6%E7%BF%B0%E5%B0%BC%C2%B7%E5%BE%B7%E6%99%AE\">约翰尼·德普</a>、<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E5%A5%A5%E5%85%B0%E5%A4%9A%C2%B7%E5%B8%83%E9%B2%81%E5%A7%86\">奥兰多·布鲁姆</a>、<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E5%93%88%E7%BB%B4%E5%B0%94%C2%B7%E5%B7%B4%E7%99%BB\">哈维尔·巴登</a>、<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E6%9D%B0%E5%BC%97%E9%87%8C%C2%B7%E6%8B%89%E4%BB%80\">杰弗里·拉什</a>等人主演<span style=\"font-size:10.9091px;line-height:0;vertical-align:baseline;color:#3366CC;\">[3]</span><a name=\"ref_[3]_11465507\"></a>&nbsp;&nbsp;。\r\n	</div>\r\n	<div class=\"para\">\r\n		该片讲述了杰克船长一行人怀揣着各自的目的踏上寻找传说中海神波塞冬的三叉戟的奇幻冒险故事<span style=\"font-size:10.9091px;line-height:0;vertical-align:baseline;color:#3366CC;\">[4]</span><a name=\"ref_[4]_11465507\"></a>&nbsp;&nbsp;。\r\n	</div>\r\n	<div class=\"para\">\r\n		该片于2017年5月26日在北美及中国大陆同步公映<span style=\"font-size:10.9091px;line-height:0;vertical-align:baseline;color:#3366CC;\">[5]</span><a name=\"ref_[5]_11465507\"></a>&nbsp;&nbsp;。\r\n	</div>\r\n</div>\r\n<div class=\"basic-info cmn-clearfix\" style=\"margin:20px 0px 35px;background:url(&quot;color:#333333;font-family:arial, 宋体, sans-serif;\">\r\n	中文名加勒比海盗5：死无对证<span style=\"font-size:10.9091px;line-height:0;vertical-align:baseline;color:#3366CC;\">[1]</span><a name=\"ref_[1]_11465507\"></a>&nbsp;外文名Pirates of the Caribbean: Dead Men Tell No Tales/Salazar\'s Revenge<span style=\"font-size:10.9091px;line-height:0;vertical-align:baseline;color:#3366CC;\">[2]</span><a name=\"ref_[2]_11465507\"></a>&nbsp;其它译名死无对证、亡灵的缄默、亡者无言、死人不会告密、萨拉查的复仇<span style=\"font-size:10.9091px;line-height:0;vertical-align:baseline;color:#3366CC;\">[6]</span><a name=\"ref_[6]_11465507\"></a>&nbsp;出品时间2017年出品公司迪士尼影片公司、杰瑞·布鲁克海默电影公司发行公司迪士尼影片公司制片地区美国制片成本2.3亿美元<span style=\"font-size:10.9091px;line-height:0;vertical-align:baseline;color:#3366CC;\">[7]</span><a name=\"ref_[7]_11465507\"></a>&nbsp;拍摄地点昆士兰、澳大利亚拍摄日期2015年导&nbsp;&nbsp;&nbsp;&nbsp;演<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E4%B9%94%E9%98%BF%E5%90%89%E5%A7%86%C2%B7%E7%BD%97%E6%81%A9%E5%B0%BC\">乔阿吉姆·罗恩尼</a>、<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E8%89%BE%E6%96%AF%E5%BD%AD%C2%B7%E5%B1%B1%E5%BE%B7%E4%BC%AF%E6%A0%BC\">艾斯彭·山德伯格</a>编&nbsp;&nbsp;&nbsp;&nbsp;剧<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E6%96%AF%E5%9B%BE%E5%B0%94%E7%89%B9%C2%B7%E6%AF%94%E8%92%82\">斯图尔特·比蒂</a>、泰德·埃里奥特、<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E6%9D%B0%E5%A4%AB%C2%B7%E5%86%85%E6%A1%91%E6%A3%AE\">杰夫·内桑森</a>、<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E7%89%B9%E9%87%8C%C2%B7%E9%B2%81%E8%A5%BF%E5%A5%A5\">特里·鲁西奥</a>制片人<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E6%9D%B0%E7%91%9E%C2%B7%E5%B8%83%E9%B2%81%E5%85%8B%E6%B5%B7%E9%BB%98\">杰瑞·布鲁克海默</a>类&nbsp;&nbsp;&nbsp;&nbsp;型动作、奇幻、冒险、探险主&nbsp;&nbsp;&nbsp;&nbsp;演<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E7%BA%A6%E7%BF%B0%E5%B0%BC%C2%B7%E5%BE%B7%E6%99%AE\">约翰尼·德普</a>，<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E5%A5%A5%E5%85%B0%E5%A4%9A%C2%B7%E5%B8%83%E9%B2%81%E5%A7%86\">奥兰多·布鲁姆</a>，<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E6%9D%B0%E5%BC%97%E9%87%8C%C2%B7%E6%8B%89%E4%BB%80\">杰弗里·拉什</a>，<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E5%93%88%E7%BB%B4%E5%B0%94%C2%B7%E5%B7%B4%E7%99%BB\">哈维尔·巴登</a>，<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E5%B8%83%E5%85%B0%E9%A1%BF%C2%B7%E6%80%9D%E6%80%80%E5%85%B9\">布兰顿·思怀兹</a>，<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E5%8D%A1%E9%9B%85%C2%B7%E6%96%AF%E8%80%83%E8%BE%BE%E9%87%8C%E5%A5%A5\">卡雅·斯考达里奥</a>，<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E5%87%AF%E6%96%87%C2%B7%E9%BA%A6%E5%85%8B%E7%BA%B3%E5%88%A9\">凯文·麦克纳利</a>片&nbsp;&nbsp;&nbsp;&nbsp;长129分钟上映时间2017年5月26日(中国大陆/美国)<span style=\"font-size:10.9091px;line-height:0;vertical-align:baseline;color:#3366CC;\">[8]</span><a name=\"ref_[8]_11465507\"></a>&nbsp;票&nbsp;&nbsp;&nbsp;&nbsp;房$794,611,287（全球）&nbsp;<span style=\"font-size:10.9091px;line-height:0;vertical-align:baseline;color:#3366CC;\">[7]</span><a name=\"ref_[7]_11465507\"></a>&nbsp;分&nbsp;&nbsp;&nbsp;&nbsp;级PG-13<span style=\"font-size:10.9091px;line-height:0;vertical-align:baseline;color:#3366CC;\">[3]</span><a name=\"ref_[3]_11465507\"></a>&nbsp;对白语言英语色&nbsp;&nbsp;&nbsp;&nbsp;彩彩色imdb编码tt1790809\r\n</div>\r\n<div class=\"anchor-list\" style=\"color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<a name=\"1\"></a><a name=\"sub11465507_1\"></a><a name=\"剧情简介\"></a> \r\n</div>\r\n<div class=\"para-title level-2\" style=\"font-size:22px;font-family:&quot;margin:35px 0px 15px -30px;background:url(&quot;color:#333333;\">\r\n	<h2 class=\"title-text\" style=\"font-size:22px;color:#000000;font-weight:400;\">\r\n		剧情简介\r\n	</h2>\r\n<a class=\"edit-icon j-edit-link\"><span class=\"cmn-icon wiki-lemma-icons wiki-lemma-icons_edit-lemma\" style=\"line-height:1;font-family:baikeFont_layout;vertical-align:text-bottom;color:#AAAAAA;\"></span>编辑</a> \r\n</div>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<a class=\"lemma-album layout-right nslog:10000206\" href=\"https://baike.baidu.com/pic/%E5%8A%A0%E5%8B%92%E6%AF%94%E6%B5%B7%E7%9B%975%EF%BC%9A%E6%AD%BB%E6%97%A0%E5%AF%B9%E8%AF%81/12169598/21342193/55e736d12f2eb938c3b96d5bdc628535e4dd6f46?fr=lemma&amp;ct=cover\" target=\"_blank\"> \r\n	<div class=\"album-wrap\" style=\"border:1px solid #E0E0E0;\">\r\n		<img class=\"picture\" alt=\"剧照\" src=\"https://gss0.bdstatic.com/94o3dSag_xI4khGkpoWK1HF6hhy/baike/s%3D250/sign=7dc4f6b32134349b70066980f9eb1521/55e736d12f2eb938c3b96d5bdc628535e4dd6f46.jpg\" style=\"width:250px;height:104px;\" /> \r\n	</div>\r\n	<div class=\"description\" style=\"padding:8px 7px;color:#555555;font-size:12px;font-family:simSun;\">\r\n		剧照(36张)\r\n	</div>\r\n	<div class=\"albumBg\">\r\n		<div class=\"albumBgFir\" style=\"margin:0px auto;\">\r\n		</div>\r\n		<div class=\"albumBgSec\" style=\"margin:0px auto;\">\r\n		</div>\r\n	</div>\r\n</a> \r\n</div>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	杰克船长<i>（</i><a target=\"_blank\" href=\"https://baike.baidu.com/item/%E7%BA%A6%E7%BF%B0%E5%B0%BC%C2%B7%E5%BE%B7%E6%99%AE\"><i>约翰尼·德普</i></a><i>饰）</i>发现令人闻风丧胆的萨拉查船长&nbsp;<i>（<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E5%93%88%E7%BB%B4%E5%B0%94%C2%B7%E5%B7%B4%E7%99%BB\">哈维尔·巴登</a>饰）</i>竟率领着一众夺命亡灵水手逃出了百慕大三角区。他们扬言要杀尽世上所有的海盗，头号目标就是杰克船长。要想改写命运，杰克船长唯一的希望就是找到传说中海神波塞冬的三叉戟，拥有它就能拥有统治整个海洋的力量。为了寻获这件神器，杰克船长被迫和聪明美丽的天文学家卡琳娜·史密斯<i>（</i><a target=\"_blank\" href=\"https://baike.baidu.com/item/%E5%8D%A1%E9%9B%85%C2%B7%E6%96%AF%E8%80%83%E8%BE%BE%E9%87%8C%E5%A5%A5\"><i>卡雅·斯</i><i>考达里奥</i></a><i>饰）</i>以及固执的年轻皇家海军亨<i>利（<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E5%B8%83%E5%85%B0%E9%A1%BF%C2%B7%E6%80%9D%E6%80%80%E5%85%B9\">布兰顿·思怀兹</a>饰）</i>联手出击。航行着他那破破烂烂的“黑珍珠”号，杰克船长不但决心要改变自己的厄运，同时也力求能从史上最狠毒可怕的敌人那里捡回一条命<span style=\"font-size:10.9091px;line-height:0;vertical-align:baseline;color:#3366CC;\">[1]</span><a name=\"ref_[1]_11465507\"></a>&nbsp;&nbsp;。\r\n</div>\r\n<div class=\"anchor-list\" style=\"color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<a name=\"2\"></a><a name=\"sub11465507_2\"></a><a name=\"演职员表\"></a> \r\n</div>\r\n<div class=\"para-title level-2\" style=\"font-size:22px;font-family:&quot;margin:35px 0px 15px -30px;background:url(&quot;color:#333333;\">\r\n	<h2 class=\"title-text\" style=\"font-size:22px;color:#000000;font-weight:400;\">\r\n		演职员表\r\n	</h2>\r\n<a class=\"edit-icon j-edit-link\"><span class=\"cmn-icon wiki-lemma-icons wiki-lemma-icons_edit-lemma\" style=\"line-height:1;font-family:baikeFont_layout;vertical-align:text-bottom;color:#AAAAAA;\"></span>编辑</a> \r\n</div>\r\n<div class=\"anchor-list\" style=\"color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<a name=\"2_1\"></a><a name=\"sub11465507_2_1\"></a><a name=\"演员表\"></a><a name=\"2-1\"></a> \r\n</div>\r\n<div class=\"para-title level-3\" style=\"margin:20px 0px 12px;font-size:18px;font-family:&quot;color:#333333;background-color:#FFFFFF;\">\r\n	<h3 class=\"title-text\" style=\"font-size:18px;font-weight:400;\">\r\n		演员表\r\n	</h3>\r\n</div>\r\n<div class=\"anchor-list\" style=\"color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<a name=\"actor2\"></a> \r\n</div>\r\n<div class=\"drama-actor\" style=\"color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<div class=\"viewport\" id=\"marqueeViewport_actor\">\r\n		<ul class=\"scrollBox maqueeCanvas\">\r\n			<li class=\"pages\">\r\n				<ul class=\"actorList\">\r\n					<li class=\"listItem\">\r\n						<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E7%BA%A6%E7%BF%B0%E5%B0%BC%C2%B7%E5%BE%B7%E6%99%AE/2118392\"> \r\n						<div class=\"coverPic\" style=\"margin-left:10px;\">\r\n							<img src=\"https://gss2.bdstatic.com/-fo3dSag_xI4khGkpoWK1HF6hhy/baike/crop%3D0%2C0%2C800%2C800%3Bh%3D240%3Bq%3D95/sign=5557ada8494a20a425516687ad62b412/80cb39dbb6fd5266c657c9aead18972bd407360f.jpg\" style=\"width:72px;\" /> \r\n						</div>\r\n</a><a target=\"_blank\" href=\"https://baike.baidu.com/item/%E7%BA%A6%E7%BF%B0%E5%B0%BC%C2%B7%E5%BE%B7%E6%99%AE/2118392\">约翰尼·德普</a>&nbsp;饰&nbsp;杰克·斯派洛<span style=\"color:#666666;\">简介&nbsp;&nbsp;</span>黑珍珠号船长<span style=\"color:#666666;\">配音&nbsp;&nbsp;</span>吴凌云\r\n					</li>\r\n					<li class=\"listItem\">\r\n						<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E5%93%88%E7%BB%B4%E5%B0%94%C2%B7%E5%B7%B4%E7%99%BB/2416393\"> \r\n						<div class=\"coverPic\" style=\"margin-left:10px;\">\r\n							<img src=\"https://gss2.bdstatic.com/-fo3dSag_xI4khGkpoWK1HF6hhy/baike/crop%3D0%2C0%2C240%2C240%3Bh%3D240%3Bq%3D95/sign=520d95f53c292df5838cf65581017050/908fa0ec08fa513de0743c043b6d55f