66666;\">\r\n					编剧\r\n				</td>\r\n				<td class=\"list-value\" style=\"border:0px;\">\r\n					<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E6%96%AF%E5%9B%BE%E5%B0%94%E7%89%B9%C2%B7%E6%AF%94%E8%92%82\">斯图尔特·比蒂</a>、泰德·埃里奥特、<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E6%9D%B0%E5%A4%AB%C2%B7%E5%86%85%E6%A1%91%E6%A3%AE\">杰夫·内桑森</a>、<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E7%89%B9%E9%87%8C%C2%B7%E9%B2%81%E8%A5%BF%E5%A5%A5\">特里·鲁西奥</a>、<a target=\"_blank\" href=\"https://baike.baidu.com/item/Jay%20Wolpert\">Jay Wolpert</a> \r\n				</td>\r\n			</tr>\r\n			<tr>\r\n				<td class=\"list-key\" style=\"border:0px;color:#666666;\">\r\n					配音导演\r\n				</td>\r\n				<td class=\"list-value\" style=\"border:0px;\">\r\n					张云明\r\n				</td>\r\n			</tr>\r\n			<tr>\r\n				<td class=\"list-key\" style=\"border:0px;color:#666666;\">\r\n					艺术指导\r\n				</td>\r\n				<td class=\"list-value\" style=\"border:0px;\">\r\n					奈杰尔·费尔普斯\r\n				</td>\r\n			</tr>\r\n			<tr>\r\n				<td class=\"list-key\" style=\"border:0px;color:#666666;\">\r\n					视觉特效\r\n				</td>\r\n				<td class=\"list-value\" style=\"border:0px;\">\r\n					加里·布洛占尼奇、<a target=\"_blank\" href=\"https://baike.baidu.com/item/Arne%20Kaupang\">Arne Kaupang</a> \r\n				</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n<span class=\"more\" style=\"line-height:1;background:url(&quot;\"><a>展开</a></span> \r\n</div>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<i>（演职员表参考<span style=\"font-size:10.9091px;line-height:0;vertical-align:baseline;color:#3366CC;\">[9]</span><a name=\"ref_[9]_11465507\"></a>&nbsp;&nbsp;）</i> \r\n</div>\r\n<div class=\"anchor-list\" style=\"color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<a name=\"3\"></a><a name=\"sub11465507_3\"></a><a name=\"角色介绍\"></a> \r\n</div>\r\n<div class=\"para-title level-2\" style=\"font-size:22px;font-family:&quot;margin:35px 0px 15px -30px;background:url(&quot;color:#333333;\">\r\n	<h2 class=\"title-text\" style=\"font-size:22px;color:#000000;font-weight:400;\">\r\n		角色介绍\r\n	</h2>\r\n<a class=\"edit-icon j-edit-link\"><span class=\"cmn-icon wiki-lemma-icons wiki-lemma-icons_edit-lemma\" style=\"line-height:1;font-family:baikeFont_layout;vertical-align:text-bottom;color:#AAAAAA;\"></span>编辑</a> \r\n</div>\r\n<div class=\"anchor-list\" style=\"color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<a name=\"juesejieshao\"></a> \r\n</div>\r\n<div class=\"lemmaWgt-roleIntroduction\" style=\"color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<ul>\r\n		<li class=\"roleIntroduction-item \">\r\n			<a class=\"roleIntrodcution-picture\" href=\"https://baike.baidu.com/pic/%E5%8A%A0%E5%8B%92%E6%AF%94%E6%B5%B7%E7%9B%975%EF%BC%9A%E6%AD%BB%E6%97%A0%E5%AF%B9%E8%AF%81/12169598/0/aa18972bd40735faf3d5bf7697510fb30e2408d3?fr=lemma\" target=\"_blank\"><img src=\"https://gss1.bdstatic.com/-vo3dSag_xI4khGkpoWK1HF6hhy/baike/crop%3D0%2C24%2C573%2C815%3Bh%3D195%3Bq%3D95/sign=a42df7058b8ba61ecba1926f7c04bb38/aa18972bd40735faf3d5bf7697510fb30e2408d3.jpg\" alt=\"\" style=\"width:135px;\" /></a> \r\n			<div class=\"role-name\" style=\"margin:0px 0px 3px;font-family:arial, tahoma, &quot;font-size:16px;\">\r\n				<span class=\"item-value\">杰克·史派罗</span> \r\n			</div>\r\n			<div class=\"role-actor\" style=\"font-family:arial, tahoma, &quot;\">\r\n				<span class=\"item-key\" style=\"color:#999999;\">演员</span><span class=\"item-value\">&nbsp;<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E7%BA%A6%E7%BF%B0%E5%B0%BC%C2%B7%E5%BE%B7%E6%99%AE\">约翰尼·德普</a></span> \r\n			</div>\r\n			<div class=\"role-voice\" style=\"margin:0px 0px 5px;font-family:arial, tahoma, &quot;\">\r\n			</div>\r\n几经辗转最终成为黑珍珠号的船长，有着独特的魅力和时而幽默时而认真的性格。亦正亦邪，不讲究个人卫生。有人认为他是最伟大的海盗，也有人认为他是最奸恶的海盗。史派罗最爱的黑珍珠号被封印在玻璃瓶里，自己也一直霉运缠身。然而他还要面对更可怕的考验：亡灵死敌萨拉查船长要追杀他，他必须用尽各种计谋保住自己的命。\r\n		</li>\r\n		<li class=\"roleIntroduction-item \">\r\n			<a class=\"roleIntrodcution-picture\" href=\"https://baike.baidu.com/pic/%E5%8A%A0%E5%8B%92%E6%AF%94%E6%B5%B7%E7%9B%975%EF%BC%9A%E6%AD%BB%E6%97%A0%E5%AF%B9%E8%AF%81/12169598/0/c9fcc3cec3fdfc036d731277dd3f8794a5c226f2?fr=lemma\" target=\"_blank\"><img src=\"https://gss3.bdstatic.com/7Po3dSag_xI4khGkpoWK1HF6hhy/baike/crop%3D0%2C9%2C573%2C815%3Bh%3D195%3Bq%3D95/sign=c25b9104bbfb43160e50203a1d946a1a/c9fcc3cec3fdfc036d731277dd3f8794a5c226f2.jpg\" alt=\"\" style=\"width:135px;\" /></a> \r\n			<div class=\"role-name\" style=\"margin:0px 0px 3px;font-family:arial, tahoma, &quot;font-size:16px;\">\r\n				<span class=\"item-value\">萨拉查船长</span> \r\n			</div>\r\n			<div class=\"role-actor\" style=\"font-family:arial, tahoma, &quot;\">\r\n				<span class=\"item-key\" style=\"color:#999999;\">演员</span><span class=\"item-value\">&nbsp;<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E5%93%88%E7%BB%B4%E5%B0%94%C2%B7%E5%B7%B4%E7%99%BB\">哈维尔·巴登</a></span> \r\n			</div>\r\n			<div class=\"role-voice\" style=\"margin:0px 0px 5px;font-family:arial, tahoma, &quot;\">\r\n			</div>\r\n人称“海上屠夫”，是令人畏惧的“沉默玛丽号”船长。一直想干掉杰克船长，在得知三叉戟能够消灭杰克之后，不远万里和风险要弄到三叉戟，势必要为兄弟报仇雪恨！他带领着可怕的亡灵船员毫不留情地清理加勒比海域的海盗。他总是留下一个活口，将可怕的传说传播出去。\r\n		</li>\r\n		<li class=\"roleIntroduction-item \">\r\n			<a class=\"roleIntrodcution-picture\" href=\"https://baike.baidu.com/pic/%E5%8A%A0%E5%8B%92%E6%AF%94%E6%B5%B7%E7%9B%975%EF%BC%9A%E6%AD%BB%E6%97%A0%E5%AF%B9%E8%AF%81/12169598/0/f636afc379310a559ea02f3bbe4543a98326107c?fr=lemma\" target=\"_blank\"><img src=\"https://gss1.bdstatic.com/-vo3dSag_xI4khGkpoWK1HF6hhy/baike/crop%3D0%2C24%2C573%2C815%3Bh%3D195%3Bq%3D95/sign=5f3283efb012c8fca0bcac8dc133be77/f636afc379310a559ea02f3bbe4543a98326107c.jpg\" alt=\"\" style=\"width:135px;\" /></a> \r\n			<div class=\"role-name\" style=\"margin:0px 0px 3px;font-family:arial, tahoma, &quot;font-size:16px;\">\r\n				<span class=\"item-value\">卡瑞娜·史密斯</span> \r\n			</div>\r\n			<div class=\"role-actor\" style=\"font-family:arial, tahoma, &quot;\">\r\n				<span class=\"item-key\" style=\"color:#999999;\">演员</span><span class=\"item-value\">&nbsp;<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E5%8D%A1%E9%9B%85%C2%B7%E6%96%AF%E8%80%83%E8%BE%BE%E9%87%8C%E5%A5%A5\">卡雅·斯考达里奥</a></span> \r\n			</div>\r\n			<div class=\"role-voice\" style=\"margin:0px 0px 5px;font-family:arial, tahoma, &quot;\">\r\n			</div>\r\n天文学家，卡琳娜聪慧而坚毅，年纪轻轻便精通数学和天文学，更有与其学识和品质相匹配的美貌。她的武器不是刀剑，而是一本伽利略的日记，是她未曾谋面的父亲留给她的。这本日记上有关于星星的记载，将带领她找到最大的宝藏——拥有该宝藏，就拥有控制整个海洋的力量。\r\n		</li>\r\n		<li class=\"roleIntroduction-item \">\r\n			<a class=\"roleIntrodcution-picture\" href=\"https://baike.baidu.com/pic/%E5%8A%A0%E5%8B%92%E6%AF%94%E6%B5%B7%E7%9B%975%EF%BC%9A%E6%AD%BB%E6%97%A0%E5%AF%B9%E8%AF%81/12169598/0/622762d0f703918fc109cc05583d269758eec421?fr=lemma\" target=\"_blank\"><img src=\"https://gss1.bdstatic.com/9vo3dSag_xI4khGkpoWK1HF6hhy/baike/crop%3D0%2C24%2C573%2C815%3Bh%3D195%3Bq%3D95/sign=6bb077e6e2c4b74520dbed56f2cc3225/622762d0f703918fc109cc05583d269758eec421.jpg\" alt=\"\" style=\"width:135px;\" /></a> \r\n			<div class=\"role-name\" style=\"margin:0px 0px 3px;font-family:arial, tahoma, &quot;font-size:16px;\">\r\n				<span class=\"item-value\">亨利·特纳</span> \r\n			</div>\r\n			<div class=\"role-actor\" style=\"font-family:arial, tahoma, &quot;\">\r\n				<span class=\"item-key\" style=\"color:#999999;\">演员</span><span class=\"item-value\">&nbsp;<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E5%B8%83%E5%85%B0%E9%A1%BF%C2%B7%E6%80%9D%E6%80%80%E5%85%B9\">布兰顿·思怀兹</a></span> \r\n			</div>\r\n			<div class=\"role-voice\" style=\"margin:0px 0px 5px;font-family:arial, tahoma, &quot;\">\r\n			</div>\r\n威尔和伊丽莎白的儿子，亨利是在皇家海军服役的年轻水手，相貌英俊，充满活力。他往来于各个海域，只为找寻海神波塞冬的三叉戟，用三叉戟解救被诅咒的父亲。\r\n		</li>\r\n		<li class=\"roleIntroduction-item \">\r\n			<a class=\"roleIntrodcution-picture\" href=\"https://baike.baidu.com/pic/%E5%8A%A0%E5%8B%92%E6%AF%94%E6%B5%B7%E7%9B%975%EF%BC%9A%E6%AD%BB%E6%97%A0%E5%AF%B9%E8%AF%81/12169598/0/3801213fb80e7bece659f22e262eb9389a506b7a?fr=lemma\" target=\"_blank\"><img src=\"https://gss2.bdstatic.com/9fo3dSag_xI4khGkpoWK1HF6hhy/baike/crop%3D0%2C18%2C573%2C815%3Bh%3D195%3Bq%3D95/sign=6594a4a62c2dd42a4b465beb3e0b7784/3801213fb80e7bece659f22e262eb9389a506b7a.jpg\" alt=\"\" style=\"width:135px;\" /></a> \r\n			<div class=\"role-name\" style=\"margin:0px 0px 3px;font-family:arial, tahoma, &quot;font-size:16px;\">\r\n				<span class=\"item-value\">赫克托·巴博萨</span> \r\n			</div>\r\n			<div class=\"role-actor\" style=\"font-family:arial, tahoma, &quot;\">\r\n				<span class=\"item-key\" style=\"color:#999999;\">演员</span><span class=\"item-value\">&nbsp;<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E6%9D%B0%E5%BC%97%E9%87%8C%C2%B7%E6%8B%89%E4%BB%80\">杰弗里·拉什</a></span> \r\n			</div>\r\n			<div class=\"role-voice\" style=\"margin:0px 0px 5px;font-family:arial, tahoma, &quot;\">\r\n			</div>\r\n与杰克是死敌，原先是他的大副，后背叛了他。在外也鼎鼎有名，在第四部中，击败了臭名昭著的海盗黑胡子，并且统治了他的船：安妮女王复仇号。和杰克有和好的趋势。巴波萨十分精明，擅长以小博大，是交易高手，同时也是击剑高手。现在他与十分危险的一方结盟，共同出发寻找海神的三叉戟。\r\n		</li>\r\n		<li class=\"roleIntroduction-item \">\r\n			<a class=\"roleIntrodcution-picture\" href=\"https://baike.baidu.com/pic/%E5%8A%A0%E5%8B%92%E6%AF%94%E6%B5%B7%E7%9B%975%EF%BC%9A%E6%AD%BB%E6%97%A0%E5%AF%B9%E8%AF%81/12169598/0/203fb80e7bec54e78bbc928cbf389b504ec26ad4?fr=lemma\" target=\"_blank\"><img src=\"https://gss1.bdstatic.com/-vo3dSag_xI4khGkpoWK1HF6hhy/baike/crop%3D0%2C0%2C290%2C412%3Bh%3D195%3Bq%3D95/sign=75f86ce1ab4bd1131082ed72679f883f/203fb80e7bec54e78bbc928cbf389b504ec26ad4.jpg\" alt=\"\" style=\"width:135px;\" /></a> \r\n			<div class=\"role-name\" style=\"margin:0px 0px 3px;font-family:arial, tahoma, &quot;font-size:16px;\">\r\n				<span class=\"item-value\">威尔·特纳</span> \r\n			</div>\r\n			<div class=\"role-actor\" style=\"font-family:arial, tahoma, &quot;\">\r\n				<span class=\"item-key\" style=\"color:#999999;\">演员</span><span class=\"item-value\">&nbsp;<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E5%A5%A5%E5%85%B0%E5%A4%9A%C2%B7%E5%B8%83%E9%B2%81%E5%A7%86\">奥兰多·布鲁姆</a></span> \r\n			</div>\r\n			<div class=\"role-voice\" style=\"margin:0px 0px 5px;font-family:arial, tahoma, &quot;\">\r\n			</div>\r\n威尔本为戴维琼斯可怕的海盗船上的水手，在第三部中，他击败了戴维琼斯，把船员从诅咒中解脱了出来，并且成为了戴维琼斯的爱船：飞天荷兰人号新的船长，还获得了永生的权利。但是代价是十年才能上岸一次。在经历的种种后的威尔终于与儿子和妻子相见。\r\n		</li>\r\n	</ul>\r\n	<div class=\"expand-all-container\" style=\"text-align:right;\">\r\n	</div>\r\n</div>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<i>（角色介绍参考资料<span style=\"font-size:10.9091px;line-height:0;vertical-align:baseline;color:#3366CC;\">[10]</span><a name=\"ref_[10]_11465507\"></a>&nbsp;&nbsp;</i><i>）</i> \r\n</div>\r\n<div class=\"anchor-list\" style=\"color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<a name=\"4\"></a><a name=\"sub11465507_4\"></a><a name=\"幕后花絮\"></a> \r\n</div>\r\n<div class=\"para-title level-2\" style=\"font-size:22px;font-family:&quot;margin:35px 0px 15px -30px;background:url(&quot;color:#333333;\">\r\n	<h2 class=\"title-text\" style=\"font-size:22px;color:#000000;font-weight:400;\">\r\n		幕后花絮\r\n	</h2>\r\n<a class=\"edit-icon j-edit-link\"><span class=\"cmn-icon wiki-lemma-icons wiki-lemma-icons_edit-lemma\" style=\"line-height:1;font-family:baikeFont_layout;vertical-align:text-bottom;color:#AAAAAA;\"></span>编辑</a> \r\n</div>\r\n<ol class=\"custom_num para-list list-paddingleft-1\" style=\"color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<li class=\"list-num-1-1 list-num-paddingleft-1\">\r\n		<div class=\"para\" style=\"font-size:14px;margin-left:25px;\">\r\n			奥兰多在奥兹漫展的讨论环节里透露，他乐于加入“海盗5”的一个主要原因就是能跟约翰尼·德普再次合作，他是德普的忠实粉丝<span style=\"font-size:10.9091px;line-height:0;vertical-align:baseline;color:#3366CC;\">[11]</span><a name=\"ref_[11]_11465507\"></a>&nbsp;&nbsp;。\r\n		</div>\r\n	</li>\r\n	<li class=\"list-num-1-2 list-num-paddingleft-1\">\r\n		<div class=\"para\" style=\"font-size:14px;margin-left:25px;\">\r\n			2013年9月11日，迪士尼宣布，将原定于2015年7月10日上映的《加勒比海盗5》挪后至2016年，具体日期还未确定<span style=\"font-size:10.9091px;line-height:0;vertical-align:baseline;color:#3366CC;\">[12]</span><a name=\"ref_[12]_11465507\"></a>&nbsp;。\r\n		</div>\r\n	</li>\r\n	<li class=\"list-num-1-3 list-num-paddingleft-1\">\r\n		<div class=\"para\" style=\"font-size:14px;margin-left:25px;\">\r\n			《加勒比海盗5：死无对证》，从2017年7月7日提前至2017年5月26日<span style=\"font-size:10.9091px;line-height:0;vertical-align:baseline;color:#3366CC;\">[13]</span><a name=\"ref_[13]_11465507\"></a>&nbsp;&nbsp;。\r\n		</div>\r\n	</li>\r\n	<li class=\"list-num-1-4 list-num-paddingleft-1\">\r\n		<div class=\"para\" style=\"font-size:14px;margin-left:25px;\">\r\n			伊丽莎白·斯旺<i>（凯拉·奈特莉饰演）</i>和威尔·特纳<i>（奥兰多·布鲁姆饰演）</i>确认在《加勒比海盗5》中回归，与约翰尼·德普饰演的杰克船长再度组成\"铁三角\"<span style=\"font-size:10.9091px;line-height:0;vertical-align:baseline;color:#3366CC;\">[14]</span><a name=\"ref_[14]_11465507\"></a>&nbsp;&nbsp;。\r\n		</div>\r\n	</li>\r\n	<li class=\"list-num-1-5 list-num-paddingleft-1\">\r\n		<div class=\"para\" style=\"font-size:14px;margin-left:25px;\">\r\n			为了在片中展现出杰克船长依旧苗条的身材，德普在片场不但要穿塑身衣，许多镜头还得依靠替身来拍摄。而在之前预告中你看所到的“瘦版”杰克船长，则是依靠了强大的化妆和打光技术完成的<span style=\"font-size:10.9091px;line-height:0;vertical-align:baseline;color:#3366CC;\">[15]</span><a name=\"ref_[15]_11465507\"></a>&nbsp;&nbsp;。\r\n		</div>\r\n	</li>\r\n	<li class=\"list-num-1-6 list-num-paddingleft-1\">\r\n		<div class=\"para\" style=\"font-size:14px;margin-left:25px;\">\r\n			在城镇内的一场骚乱戏份中有许多群众演员，这非常考验导演的场面调度能力以及演员们的功底，由于片场四处都有摄像机，许多地方还会给特写，所以一旦有人脱戏，那么在观众眼里就很容易看出穿帮了<span style=\"font-size:10.9091px;line-height:0;vertical-align:baseline;color:#3366CC;\">[15]</span><a name=\"ref_[15]_11465507\"></a>&nbsp;&nbsp;。\r\n		</div>\r\n	</li>\r\n	<li class=\"list-num-1-7 list-num-paddingleft-1\">\r\n		<div class=\"para\" style=\"font-size:14px;margin-left:25px;\">\r\n			《加勒比海盗5》初期在澳大利亚昆士兰州黄金海岸进行拍摄时，遭遇旋风“玛莎”来袭，还遇上了当地61年以来最潮湿的天气<span style=\"font-size:10.9091px;line-height:0;vertical-align:baseline;color:#3366CC;\">[16]</span><a name=\"ref_[16]_11465507\"></a>&nbsp;&nbsp;。\r\n		</div>\r\n	</li>\r\n	<li class=\"list-num-1-8 list-num-paddingleft-1\">\r\n		<div class=\"para\" style=\"font-size:14px;margin-left:25px;\">\r\n			《加勒比海盗5》中饰演亨利的年轻演员布兰顿·思怀兹，从小就是《加勒比海盗》系列电影的忠实粉丝，这次不仅是他在《加勒比海盗5》中担任主角，而且几乎全片都是在他的故乡澳大利亚昆士兰州拍摄<span style=\"font-size:10.9091px;line-height:0;vertical-align:baseline;color:#3366CC;\">[16]</span><a name=\"ref_[16]_11465507\"></a>&nbsp;&nbsp;。\r\n		</div>\r\n	</li>\r\n	<li class=\"list-num-1-9 list-num-paddingleft-1\">\r\n		<div class=\"para\" style=\"font-size:14px;margin-left:25px;\">\r\n			歌什菲·法拉哈尼在片中饰演海洋女巫珊萨，她的一件服装需要整整一周的时间，每天花费15个小时，42人共同赶制<span style=\"font-size:10.9091px;line-height:0;vertical-align:baseline;color:#3366CC;\">[16]</span><a name=\"ref_[16]_11465507\"></a>&nbsp;。\r\n		</div>\r\n	</li>\r\n	<li class=\"list-num-1-10 list-num-paddingleft-1\">\r\n		<div class=\"para\" style=\"font-size:14px;margin-left:25px;\">\r\n			剧组主要发型设计师彼得·索德金所在的部门为影片创造了超过1000顶假发，最高纪录在一天之内给700名群演和30位主演使用<span style=\"font-size:10.9091px;line-height:0;vertical-align:baseline;color:#3366CC;\">[16]</span><a name=\"ref_[16]_11465507\"></a>&nbsp;&nbsp;。\r\n		</div>\r\n	</li>\r\n	<li class=\"list-num-1-11 list-num-paddingleft-1\">\r\n		<div class=\"para\" style=\"font-size:14px;margin-left:25px;\">\r\n			因为被诅咒的萨拉查船长妆面复杂，演员哈维尔·巴登每天要化2-3个小时的妆。这还不是最长的纪录，当美丽的歌什菲·法拉哈尼变成神秘的海洋女巫珊萨，化妆需要4-5个小时。整个化妆部门主要团队共有22人，另外还有70人在一个大帐篷里为背景演员、特技演员和牧马人化妆，他们管这个帐篷叫“香肠厂”<span style=\"font-size:10.9091px;line-height:0;vertical-align:baseline;color:#3366CC;\">[16]</span><a name=\"ref_[16]_11465507\"></a>&nbsp;&nbsp;。\r\n		</div>\r\n	</li>\r\n	<li class=\"list-num-1-12 list-num-paddingleft-1\">\r\n		<div class=\"para\" style=\"font-size:14px;margin-left:25px;\">\r\n			剧组服装设计潘妮·罗斯与她的团队将其整个变成衣柜，装满了服装、帽子、鞋子和配饰，总件数超过2000件<span style=\"font-size:10.9091px;line-height:0;vertical-align:baseline;color:#3366CC;\">[16]</span><a name=\"ref_[16]_11465507\"></a>&nbsp;&nbsp;。\r\n		</div>\r\n	</li>\r\n	<li class=\"list-num-1-13 list-num-paddingleft-1\">\r\n		<div class=\"para\" style=\"font-size:14px;margin-left:25px;\">\r\n			在圣灵群岛拍摄的场面，动用了60辆卡车，从黄金海岸基地行驶1400公里，然后从陆地到汉密尔顿岛上需要40分钟的车程，去其他岛屿还需要再坐一个半小时的驳船<span style=\"font-size:10.9091px;line-height:0;vertical-align:baseline;color:#3366CC;\">[16]</span><a name=\"ref_[16]_11465507\"></a>&nbsp;&nbsp;。\r\n		</div>\r\n	</li>\r\n	<li class=\"list-num-1-14 list-num-paddingleft-1\">\r\n		<div class=\"para\" style=\"font-size:14px;margin-left:25px;\">\r\n			在拍摄行刑场断头台旋转一幕的那天，圣马丁下起了暴雨。为了保持地面干燥以便拍摄，剧组动用了30吨干燥的沙子铺在地上<span style=\"font-size:10.9091px;line-height:0;vertical-align:baseline;color:#3366CC;\">[16]</span><a name=\"ref_[16]_11465507\"></a>&nbsp;&nbsp;。\r\n		</div>\r\n	</li>\r\n	<li class=\"list-num-1-15 list-num-paddingleft-1\">\r\n		<div class=\"para\" style=\"font-size:14px;margin-left:25px;\">\r\n			《加勒比海盗5》片源被盗，黑客索要大笔比特币赎金，迪士尼和FBI合作展开调查，并不打算支付赎金<span style=\"font-size:10.9091px;line-height:0;vertical-align:baseline;color:#3366CC;\">[17]</span><a name=\"ref_[17]_11465507\"></a>&nbsp;&nbsp;。\r\n		</div>\r\n	</li>\r\n</ol>\r\n<div class=\"anchor-list\" style=\"color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<a name=\"5\"></a><a name=\"sub11465507_5\"></a><a name=\"幕后制作\"></a> \r\n</div>\r\n<div class=\"para-title level-2\" style=\"font-size:22px;font-family:&quot;margin:35px 0px 15px -30px;background:url(&quot;color:#333333;\">\r\n	<h2 class=\"title-text\" style=\"font-size:22px;color:#000000;font-weight:400;\">\r\n		幕后制作\r\n	</h2>\r\n<a class=\"edit-icon j-edit-link\"><span class=\"cmn-icon wiki-lemma-icons wiki-lemma-icons_edit-lemma\" style=\"line-height:1;font-family:baikeFont_layout;vertical-align:text-bottom;color:#AAAAAA;\"></span>编辑</a> \r\n</div>\r\n<div class=\"anchor-list\" style=\"color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<a name=\"5_1\"></a><a name=\"sub11465507_5_1\"></a><a name=\"剧本创作\"></a><a name=\"5-1\"></a> \r\n</div>\r\n<div class=\"para-title level-3\" style=\"margin:20px 0px 12px;font-size:18px;font-family:&quot;color:#333333;background-color:#FFFFFF;\">\r\n	<h3 class=\"title-text\" style=\"font-size:18px;font-weight:400;\">\r\n		剧本创作\r\n	</h3>\r\n</div>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	2011年7月，\r\n	<div class=\"lemma-picture text-pic layout-right\" style=\"border:1px solid #E0E0E0;margin:0px 0px 3px;\">\r\n		<a class=\"image-link\" href=\"https://baike.baidu.com/pic/%E5%8A%A0%E5%8B%92%E6%AF%94%E6%B5%B7%E7%9B%975%EF%BC%9A%E6%AD%BB%E6%97%A0%E5%AF%B9%E8%AF%81/12169598/0/9345d688d43f87944d589932d11b0ef41bd53a03?fr=lemma&amp;ct=single\" target=\"_blank\"><img class=\"\" src=\"https://gss1.bdstatic.com/9vo3dSag_xI4khGkpoWK1HF6hhy/baike/s%3D220/sign=642b2f3f4a540923ae69647ca259d1dc/9345d688d43f87944d589932d11b0ef41bd53a03.jpg\" alt=\"\" style=\"width:213px;height:220px;\" /></a> \r\n	</div>\r\n《加勒比海盗5》剧本已提交迪士尼高层。《加勒比海盗》系列第四部《<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E5%8A%A0%E5%8B%92%E6%AF%94%E6%B5%B7%E7%9B%97%EF%BC%9A%E6%83%8A%E6%B6%9B%E6%80%AA%E6%B5%AA\">加勒比海盗：惊涛怪浪</a>》，但作为影片编剧之一的特里·鲁西奥已经写完了《加勒比海盗5》第一版剧本，并交给迪士尼高层审阅。值得一提的是，这次他“抛弃”了之前与自己合作前三部的编剧泰德·埃里奥特，首次独立撰写《加勒比海盗》剧本<span style=\"font-size:10.9091px;line-height:0;vertical-align:baseline;color:#3366CC;\">[18]</span><a name=\"ref_[18]_11465507\"></a>&nbsp;&nbsp;。\r\n</div>\r\n<div class=\"anchor-list\" style=\"color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<a name=\"5_2\"></a><a name=\"sub11465507_5_2\"></a><a name=\"敲定片名\"></a><a name=\"5-2\"></a> \r\n</div>\r\n<div class=\"para-title level-3\" style=\"margin:20px 0px 12px;font-size:18px;font-family:&quot;color:#333333;background-color:#FFFFFF;\">\r\n	<h3 class=\"title-text\" style=\"font-size:18px;font-weight:400;\">\r\n		敲定片名\r\n	</h3>\r\n</div>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<a class=\"lemma-album layout-right nslog:10000206\" href=\"https://baike.baidu.com/pic/%E5%8A%A0%E5%8B%92%E6%AF%94%E6%B5%B7%E7%9B%975%EF%BC%9A%E6%AD%BB%E6%97%A0%E5%AF%B9%E8%AF%81/12169598/11839970/3812b31bb051f819a6aedfb1d8b44aed2f73e746?fr=lemma&amp;ct=cover\" target=\"_blank\"> \r\n	<div class=\"album-wrap\" style=\"border:1px solid #E0E0E0;\">\r\n		<img class=\"picture\" alt=\"经典图片\" src=\"https://gss0.bdstatic.com/94o3dSag_xI4khGkpoWK1HF6hhy/baike/s%3D220/sign=a17dd010b4fd5266a32b3b169b199799/3812b31bb051f819a6aedfb1d8b44aed2f73e746.jpg\" style=\"width:215px;height:220px;\" /> \r\n	</div>\r\n	<div class=\"description\" style=\"padding:8px 7px;color:#555555;font-size:12px;font-family:simSun;\">\r\n		经典图片(7张)\r\n	</div>\r\n</a> \r\n</div>\r\n<p>\r\n	<br />\r\n</p>', 'Benjamin', '2017-11-29 21:29', '2017-11-29 21:29:05.032000');
